import React from "react";
import { useState, useEffect } from "react";
import "./sidebar.css";
import axios from "axios";

//a sidebar that shows user info and logout button
// it initially should be hidden and only show when the user clicks on the profile icon
export default function Sidebar() {

    return
    (
        <div className="sidebar">
            <div className="sidebar__left">
                <div className="sidebar__left__top">
                    <div className="sidebar__left__top__profile">
                        <img src="https://www.flaticon.com/svg/static/icons/svg/3135/3135715.svg" alt="profile" />
                    </div>
                    <div className="sidebar__left__top__name">
                        <h3>Username</h3>
                    </div>
                </div>
                <div className="sidebar__left__bottom">
                    <div className="sidebar__left__bottom__logout">
                        <button>Logout</button>
                    </div>
                </div>
            </div>
        </div>

    );

}
